			<string>POD_DIR="$PODS_ROOT/SwiftGen/bin/swiftgen"
if which $POD_DIR &gt;/dev/null; then
    SRCDIR="$PROJECT_DIR/$PROJECT_NAME"
    $POD_DIR images -t swift3 "$SRCDIR/Supporting Files/Resources/Assets.xcassets" --output "$SRCDIR/Common/GeneratedConstants/Images.swift"
    $POD_DIR strings -t swift3 "$SRCDIR/Supporting Files/Translations/en.lproj/Localizable.strings" --output "$SRCDIR/Common/GeneratedConstants/Strings.swift"
    $POD_DIR colors -t swift3 "$SRCDIR/Supporting Files/Resources/Colors.xml" --output "$SRCDIR/Common/GeneratedConstants/Colors.swift"
    $POD_DIR storyboards -t swift3 "$SRCDIR" --output "$SRCDIR/Common/GeneratedConstants/Storyboards.swift"
    $POD_DIR fonts -t swift3 "$SRCDIR/Supporting Files/Resources/Fonts" --output "$SRCDIR/Common/GeneratedConstants/Fonts.swift"
else
    echo "warning: SwiftGen not installed, download it from https://github.com/AliSoftware/SwiftGen"
fi
